import React from 'react';
const charstyle = (props) =>{
    const style = {
        display: 'inline-block', 
        color: 'white',
        textSize : '50%',
        backgroundColor : 'blue',
        padding: '50px', 
        textAlign: 'center', 
        margin : '16px', 
        border: '1px solid black'
    };
    return (
      <div style= {style}>
         {props.character}

      </div>
    );
}
 
export default charstyle;
